"""### Creating preprocessing functions for our data

##### Current data format

* unit8 dtype.
* Different sized images.
* Not scaled (pixel vals between 0 & 255).

##### Preferrable data format

* float32 dtype (or for mixed precision float16 and float32).
* Tensorflow likes all tensors in batches to be of the same size.
* Scaled (vals between 0 & 1)
"""

# Using EfficientNetBX - so rescaling is not needed.

def preprocess_img(image,label,image_shape = 224):
  """
    Converts image datatype from unit8 to float32
    and resizes it

  """

  image = tf.image.resize(image,[image_shape,image_shape])

  return tf.cast(image,tf.float32),label # return (float32image,label) typle

preprocessed_image = preprocess_img(image,label)[0]

# Before
print(image,image.shape,image.dtype)

# After
print(preprocessed_image,preprocessed_image.shape,preprocessed_image.dtype)

"""##### Creating batches and preparing datasets

* We use num_parallel_calls and prefetch to speed up data loading performance.
* ![image.png](data:image/png;base64,)
* https://www.tensorflow.org/guide/data_performance#best_practice_summary
* ![image.png](data:image/png;base64,)
"""

# Mapping preprocessing function to training (and parallize)

train_data = train_data.map(map_func = preprocess_img,
                            num_parallel_calls = tf.data.AUTOTUNE)

# Shuffling data and turning it into batches and prefetching it to load it faster.

train_data = train_data.shuffle(buffer_size=1000).batch(batch_size = 32).prefetch(buffer_size = tf.data.AUTOTUNE)


# Doing the same for test data (shuffling not needed)

test_data = test_data.map(map_func = preprocess_img,
                          num_parallel_calls = tf.data.AUTOTUNE).batch(32).prefetch(tf.data.AUTOTUNE)

train_data,test_data

