"""### Setting up mixed precision training

![image.png](data:image/png;base64,)![image.png]()
"""

from tensorflow.keras import mixed_precision

mixed_precision.set_global_policy("mixed_float16")

mixed_precision.global_policy()

"""### Building Feature Extraction Model"""

from tensorflow.keras import layers

from tensorflow.keras.layers.experimental import preprocessing

# Create base model
input_shape = (224, 224, 3)

base_model = tf.keras.applications.EfficientNetB0(include_top=False)

base_model.trainable = False # freeze base model layers

# Create Functional model 

inputs = layers.Input(shape=input_shape, name="input_layer")

# Note: EfficientNetBX models have rescaling built-in but if your model didn't you could have a layer like below
# x = preprocessing.Rescaling(1./255)(inputs)

x = base_model(inputs, training=False) # set base_model to inference mode only

x = layers.GlobalAveragePooling2D(name="pooling_layer")(x)

x = layers.Dense(len(class_names))(x) # want one output neuron per class 

# Separate activation of output layer so we can output float32 activations

outputs = layers.Activation("softmax", dtype=tf.float32, name="softmax_float32")(x) 

model = tf.keras.Model(inputs, outputs)

# Since we have used mixed precision different layers may be using differing dtype polic

# we can see that using the following code:-

i = 0
for layer in model.layers:
  print(f"layer - {i}")
  print(layer.name,layer.dtype,layer.dtype_policy,end = "\n")
  print()
  i+=1

"""Even the layers of efficientnet have mixed precision

### Compiling the model
"""

model.compile(loss = "sparse_categorical_crossentropy", # Used when labels are *not* one-hot
              optimizer = "Adam",
              metrics = ["accuracy"])

"""### Fitting the feature extraction model"""

history_feature_extraction = model.fit(train_data,
                                       epochs = 3,
                                       steps_per_epoch = len(train_data),
                                       validation_data = test_data,
                                       validation_steps = 0.15*len(test_data),
                                       callbacks = [create_tensorboard_callback(dir_name = "training_logs",
                                                                                experiment_name = "EfiicientNetB0_all_data_101_Classes_feature_extraction_model"),
                                                    model_checkpoint])

results_feature_extraction_model = model.evaluate(test_data)

results_feature_extraction_model

